  const save = useSelector(selectWatchLater);
  const isSaved = save.length === 0 ? "you don't have any movies saved to your watch later" : null;


  return (
    <div className="grid-view">
      {save.map(movie => (
        <MoviesCard movie={movie} />
      ))}
    </div>
  );
}

export default WatchLater;
